$(function(){$('[data-fc="checkbox"]').each(function(){var c=$(this),e=c.find(".checkbox__input"),n=c.find(".checkbox__label");e.prop("disabled")||n.on("click",function(c){c.preventDefault(),e.prop("checked")?e.prop("checked",!1):e.prop("checked",!0)})})}),$(function(){$('[data-fc="radio"]').each(function(){var c=$(this),e=c.find(".radio__input"),n=c.find(".radio__label"),i=e.attr("name");e.prop("disabled")||n.on("click",function(c){c.preventDefault(),e.prop("checked")||($('.radio_input[name="'+i+'"]').prop("cheched",!1),e.prop("checked",!0))})})});